  \"Improved Foreign Object Damage Performance for 2D Woven Ceramic Matrix Composites
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\": 2\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T01:21:26.884876\",\n\t\"name\":
  \"improved-foreign-object-damage-performance-for-2d-woven-ceramic-matrix-composites-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"As the power density of advanced engines
  increases, the need for new materials that are capable of higher operating temperatures,
  such as ceramic matrix composites (CMCs), is critical for turbine hot-section static
  and rotating components. Such advanced materials have demonstrated the promise to
  significantly increase the engine operating temperature relative to conventional
  super alloy metallic blades. They also show the potential to enable longer life,
  reduced emissions, growth margin, reduced weight and increased performance relative
  to super alloy blade materials.rnrnMR&amp;D is proposing to perform a combined analytical,
  fabrication and experimental program to achieve the program objectives of developing
  innovative approaches to improving foreign object damage (FOD) resistance of CMC
  materials, specifically with Hyper-Therm High Temperature Ceramics's material system
  as this will be used by Rolls Royce for turbine engine hot-section components. MR&amp;D
  will develop finite element math models of the CMC material specimens and the high
  velocity metal projectiles to simulate impact testing.  The models will first be
  verified by reproducing experimental data measured on impacted baseline CMC specimens.
  Thereafter, candidate methods for potential improvement of the FOD resistance will
  be analytically investigated through mathematical simulations of impact tests.\",\n\t\"license_title\":
